INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 401, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 102301, 2, "2030/12/17 14:59:59", 24001);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 402, "2020/07/31 12:00:00", 10046, 2.21, 0.0, 102301, 2, "2030/12/17 14:59:59", 24002);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 403, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 102301, 2, "2030/12/17 14:59:59", 24003);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 701, "2020/07/31 12:00:00", 10046, 1.99, 0.0, 192201, 1, "2030/12/17 14:59:59", 24004);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 702, "2020/07/31 12:00:00", 10046, 2.21, 0.0, 192201, 2, "2030/12/17 14:59:59", 24005);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 703, "2020/07/31 12:00:00", 10046, 3.33, 0.0, 192201, 1, "2030/12/17 14:59:59", 24006);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 801, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192301, 2, "2030/12/17 14:59:59", 24007);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 802, "2020/07/31 12:00:00", 10046, 2.68, 0.0, 192301, 2, "2030/12/17 14:59:59", 24008);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 803, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192301, 2, "2030/12/17 14:59:59", 24009);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "やった！", "", 501, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192501, 1, "2030/12/17 14:59:59", 24010);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "勝ったよ！", "", 502, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192501, 1, "2030/12/17 14:59:59", 24011);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "いい調子！", "", 503, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192501, 1, "2030/12/17 14:59:59", 24012);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 111, "2020/07/31 12:00:00", 10046, 5.33, 0.0, 113501, 2, "2030/12/17 14:59:59", 24013);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 112, "2020/07/31 12:00:00", 10046, 6.85, 0.0, 113501, 2, "2030/12/17 14:59:59", 24014);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 113, "2020/07/31 12:00:00", 10046, 3.0, 0.0, 113501, 2, "2030/12/17 14:59:59", 24015);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 611, "2020/07/31 12:00:00", 10046, 6.11, 0.0, 192401, 2, "2030/12/17 14:59:59", 24016);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 612, "2020/07/31 12:00:00", 10046, 6.75, 0.0, 192401, 2, "2030/12/17 14:59:59", 24017);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 613, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192401, 2, "2030/12/17 14:59:59", 24018);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 211, "2020/07/31 12:00:00", 10046, 4.52, 0.0, 113401, 1, "2030/12/17 14:59:59", 24019);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 212, "2020/07/31 12:00:00", 10046, 3.89, 0.0, 113401, 1, "2030/12/17 14:59:59", 24020);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 213, "2020/07/31 12:00:00", 10046, 13.49, 0.0, 113401, 2, "2030/12/17 14:59:59", 24021);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 311, "2020/07/31 12:00:00", 10046, 3.17, 0.0, 106501, 2, "2030/12/17 14:59:59", 24022);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 312, "2020/07/31 12:00:00", 10046, 4.42, 0.0, 106501, 2, "2030/12/17 14:59:59", 24023);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 313, "2020/07/31 12:00:00", 10046, 2.89, 0.0, 106501, 1, "2030/12/17 14:59:59", 24024);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 421, "2020/07/31 12:00:00", 10046, 3.71, 0.0, 102301, 3, "2030/12/17 14:59:59", 24025);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 721, "2020/07/31 12:00:00", 10046, 5.1, 0.0, 192201, 1, "2030/12/17 14:59:59", 24026);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 821, "2020/07/31 12:00:00", 10046, 4.34, 0.0, 192301, 3, "2030/12/17 14:59:59", 24027);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, 0.0, "いい勝負だったよ\nまたやろうね", "", 521, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 192501, 1, "2030/12/17 14:59:59", 24028);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", 101, "2020/07/31 12:00:00", 10046, 5.62, 0.0, 113501, 2, "2030/12/17 14:59:59", 24029);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", 102, "2020/07/31 12:00:00", 10046, 9.58, 0.0, 113501, 2, "2030/12/17 14:59:59", 24030);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", 103, "2020/07/31 12:00:00", 10046, 0.0, 0.0, 113501, 2, "2030/12/17 14:59:59", 24031);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 2, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", 104, "2020/07/31 12:00:00", 10046, 9.13, 0.0, 113501, 1, "2030/12/17 14:59:59", 24032);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 1, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", 105, "2020/07/31 12:00:00", 10046, 8.27, 0.0, 113501, 2, "2030/12/17 14:59:59", 24033);
